import React, { Component } from "react";
import { Table, Button, Form } from "react-bootstrap";
import get_Business from "../services/get_Business";

import CollapsibleBusiness from "./CollapsibleBusiness";

class BusinessApplicationList extends Component {
  constructor() {
    super();
    this.state = {
      data: [],

    };

  }

  componentDidMount() {
    get_Business.Getting().then((response) => {
      this.setState({
        data: Array.from(response.data),
      });
      console.log(this.state.data);

    });
  }




  render() {
    return (
      <div>
        {/* Map each business */}
        {this.state.data.map((business) => {
          return (
            <CollapsibleBusiness
              UserID={business[0]._id}
              businessId={business[1]._id}
              applicationDate={business[1].createdAt}
              businessName={business[1].businessName}
              image="https://picsum.photos/1000/500" // To put in real images after
              businessStructure={business[1].businessStructure}
              description={business[1].descriptionOfBusiness}
              genre={business[1].genre}
              address1={business[1].address1}
              address2={business[1].address2}
              city={business[1].city}
              state={business[1].state}
              zip={business[1].postcode}
              phone={business[1].phone}
              website={business[1].website}
              email={business[1].email}
            />
          );
        })}
      </div>
    );
  }
}

export default BusinessApplicationList;
